CREATE TABLE adetsa.commerce_config (
	id bigserial NOT NULL,
	commerce_code int4 NOT NULL,
	main_color varchar(15) NULL,
	secondary_color varchar(15) NULL,
	logo1 bytea NULL,
	logo2 bytea NULL,
	background_image bytea NULL,
	terms_and_conditions text NULL,
	created_at timestamptz DEFAULT now() NOT NULL,
	status varchar(20) NOT NULL,
	date_update timestamptz DEFAULT now() NULL,
	user_update_id int8 NULL,
	CONSTRAINT pk_commerce_config PRIMARY KEY (id),
	CONSTRAINT uk_commerce_config_i UNIQUE (commerce_code)
);
CREATE INDEX ind_commerce_config_i ON adetsa.commerce_config USING btree (commerce_code);
CREATE INDEX ind_commerce_config_ii ON adetsa.commerce_config USING btree (created_at);
CREATE INDEX ind_commerce_config_iii ON adetsa.commerce_config USING btree (user_update_id);


