CREATE TABLE adetsa.roles (
	id bigserial NOT NULL,
	"name" varchar(50) NOT NULL,
	CONSTRAINT pk_role PRIMARY KEY (id),
	CONSTRAINT uk_role_i UNIQUE (name)
);
CREATE INDEX ind_role_i ON adetsa.roles USING btree (name);



CREATE TABLE adetsa.users (
	id bigserial NOT NULL,
	username varchar(10) NOT NULL,
	"password" varchar(600) NOT NULL,
	email varchar(50) NOT NULL,
	CONSTRAINT pk_users PRIMARY KEY (id),
	CONSTRAINT uk_users_i UNIQUE (username),
	CONSTRAINT uk_users_ii UNIQUE (email)
);
CREATE INDEX ind_users_i ON adetsa.users USING btree (username);
CREATE INDEX ind_users_ii ON adetsa.users USING btree (email);



CREATE TABLE adetsa.users_roles (
	id bigserial NOT NULL,
