	CONSTRAINT uk_users_roles_i UNIQUE (user_id, role_id)
);
CREATE INDEX ind_users_roles_i ON adetsa.users_roles USING btree (user_id);
CREATE INDEX ind_users_roles_ii ON adetsa.users_roles USING btree (role_id);



